interface Props {
  title: string;
  id: number;
  overview: string;
  backdrop_path: string;
}

function MoviePoster({ title, id, overview, backdrop_path }: Props) {
  const ImgUrl = "https://image.tmdb.org/t/p/w500/";

  return (
    <div>
      {title}
      <img src={ImgUrl + backdrop_path} alt="images" />
    </div>
  );
}

export default MoviePoster;
